```c
#include <stdio.h>

void bubbleSort(int array[], int size) {
    int i, j, temp;
    for (i = 0; i < size-1; i++) {     
        for (j = 0; j < size-i-1; j++) { 
            if (array[j] > array[j+1]) {
                // intercambia array[j] y array[j+1]
                temp = array[j];
                array[j] = array[j+1];
                array[j+1] = temp;
            }
        }
    }
}

void printArray(int array[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", array[i]);
    printf("\n");
}

int main() {
    int data[] = {-2, 45, 0, 11, -9};
    int n = sizeof(data) / sizeof(data[0]);
    bubbleSort(data, n);
    printf("Ordenado: \n");
    printArray(data, n);
    return 0;
}
```

Este c√≥digo primero define una funci√≥n `bubbleSort` que realiza el ordenamiento. Luego, define una funci√≥n `printArray` para imprimir el array despu√©s del ordenamiento. Finalmente, en la funci√≥n `main`, se crea un array, se llama a la funci√≥n `bubbleSort` para ordenarlo y luego se imprime el array ordenado.

