Here's a JavaScript function that takes an array of 5 numbers as input and checks if any of them is a valid prime number:

```javascript
function checkPrimeNumbers(numbers) {
  // Helper function to check if a number is prime
  function isPrime(num) {
    if (num <= 1) return false;
    for (let i = 2; i * i <= num; i++) {
      if (num % i === 0) return false;
    }
    return true;
  }

  // Check each number in the array
  for (let i = 0; i < numbers.length; i++) {
    const num = numbers[i];
    if (isPrime(num)) {
      console.log(`Number ${num} is a prime number.`);
      break;
    }
  }
}
```

To use this function, you can pass an array of 5 numbers as an argument:

```javascript
const numbers = [4, 7, 10, 13, 18];
checkPrimeNumbers(numbers);
```

This will output:
```
Number 7 is a prime number.
```

In this example, the `checkPrimeNumbers` function defines a helper function `isPrime` to determine if a number is prime. It then iterates through the input array, checking each number with `isPrime`. If a prime number is found, it logs the number to the console and exits the loop using `break`.

Crear un bucle `for` en Java es bastante sencillo. Aqu√≠ te muestro c√≥mo se hace:

```java
