Aqu√≠ est√° una explicaci√≥n detallada de cada parte:

1. **Inicializaci√≥n**: Se ejecuta una vez al inicio del bucle. Es donde declaras y inicializas cualquier variable que necesites usar en el bucle.

2. **Condici√≥n**: Este es el criterio para continuar con el bucle. Si la condici√≥n es verdadera, el bucle continuar√° ejecut√°ndose. Si es falsa, el bucle terminar√°.

3. **Actualizaci√≥n**: Esta se ejecuta despu√©s de cada iteraci√≥n del bucle. Es donde puedes actualizar las variables que est√°s utilizando en el bucle.

Aqu√≠ tienes un ejemplo de un bucle `for` que imprime los n√∫meros del 1 al 5:

```java
